import React from "react";
import "./style.css";
import chandra_mohan from '../images/avtar.png';


function Myheader(props) {
  return (
    <div>
        <section className="header_wrapper">
       <div className="navbar">
        <div className="logo">
        <img src={chandra_mohan} alt=""/>
        </div>

        <ul className="menu_name">
        <li>Home</li>
        <li>About Us</li>
        <li>Blog</li>
        <li>Contact Us</li>
        </ul>
       </div>
       </section>




    </div>
  );
}

export default Myheader;
